  `,paraId:3},{value:"Add new svg in ",paraId:7,tocIndex:2},{value:"svgs",paraId:7,tocIndex:2},{value:" folder, file name should be the same as icon name, and use the ",paraId:7,tocIndex:2},{value:"kebab-case",paraId:7,tocIndex:2},{value:" style for file name.",paraId:7,tocIndex:2},{value:"If you need to use ",paraId:8,tocIndex:2},{value:"id",paraId:8,tocIndex:2},{value:" or ",paraId:8,tocIndex:2},{value:"classname",paraId:8,tocIndex:2},{value:" in svg, you need to add the prefix ",paraId:8,tocIndex:2},{value:"ant-web3-icon-",paraId:8,tocIndex:2},{value:". This is to prevent ",paraId:8,tocIndex:2},{value:"svgo",paraId:8,tocIndex:2},{value:" from simplifying it, which causes the type to not be found. In svg, try to use the inline way to write styles, such as ",paraId:8,tocIndex:2},{value:"fill: fff",paraId:8,tocIndex:2},{value:" for colors.",paraId:8,tocIndex:2},{value:"Good writing:",paraId:9,tocIndex:2},{value:`<path
